import { useNavigate } from "react-router-dom";
import { useState } from "react";
import { Button, TextField, TextareaAutosize, Grid, Paper, Typography, Select, MenuItem, FormControl, InputLabel } from '@mui/material';
import axios from "axios";
import "./CreatePagePet.css";

const PetCreatePage = () => {
  const [name, setName] = useState("");
  const [type, setType] = useState("");
  const [description, setDescription] = useState("");
  const [skill1, setSkill1] = useState("");
  const [skill2, setSkill2] = useState("");
  const [skill3, setSkill3] = useState("");
  const navigate = useNavigate();


  const createPet = async () => {
    if (name === "" || type === "" || description === "") {
      alert("Completa los datos de la mascota");
      return;
    }

    let petObjData = {
      name: name,
      type: type,
      description: description,
      skill1: skill1,
      skill2: skill2,
      skill3: skill3,
      createdBy: "", // AÃ±adir el atributo createdBy
    };

    try {
      let responseCreate = await axios.post(
        "http://localhost:8110/api/pet/create",
        petObjData
      );

      if (responseCreate.status === 200) {
        const createdPetId = responseCreate.data._id;
        console.log(createdPetId);
        navigate("/");
        setName("");
        setType("");
        setDescription("");
        setSkill1("");
        setSkill2("");
        setSkill3("");
      }
    } catch (e) {
      console.log(e.response.data.message);
      alert(e.response.data.message);
    }
  };

  const petList = () => {
    navigate("/pets");
  };

  return (
    <div>
      <div className="headerCreate">
        <h1>Add Pet</h1>
        <button >Pet List</button>
      </div>
      <AppBar position="static" sx={{ backgroundColor: "#006b81" }}>
        <Container>
          <Toolbar>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1, color: "whitesmoke" }}>
              Lista de Pets
            </Typography>
            <div className="buttonHeader">
              <Button color="inherit" onClick={navigateToCrewBoard}>
                Crew Board
              </Button>
              <Button color="inherit" onClick={addPet}>
                Add Pet
              </Button>
            </div>
          </Toolbar>
        </Container>
      </AppBar>
      <div className="containerPet">
        <div>
          <Paper elevation={3} className="containerPet">
            <Grid container spacing={3}>
              <Grid item xs={12}>
                <Typography variant="h4" align="center">
                </Typography>
              </Grid>
              <Grid item xs={12} md={6}>
                <TextField
                  label="Pet Name"
                  fullWidth
                  value={name}
                  onChange={(e) => setName(e.target.value)}
                />
              </Grid>
              <Grid item xs={12} md={6}>
                <TextField
                  label="Pet Type"
                  fullWidth
                  value={type}
                  onChange={(e) => setType(e.target.value)}
                />
              </Grid>
              <Grid item xs={12}>
                <TextareaAutosize
                  minRows={3}
                  maxRows={10}
                  placeholder="Description"
                  style={{ width: '100%', marginTop: '10px' }}
                  value={description}
                  onChange={(e) => setDescription(e.target.value)}
                />
              </Grid>
              <Grid item xs={12}>
                <Typography variant="h6">Skills</Typography>
              </Grid>
              <Grid item xs={12} md={4}>
                <TextField
                  label="Skill 1"
                  fullWidth
                  value={skill1}
                  onChange={(e) => setSkill1(e.target.value)}
                />
              </Grid>
              <Grid item xs={12} md={4}>
                <TextField
                  label="Skill 2"
                  fullWidth
                  value={skill2}
                  onChange={(e) => setSkill2(e.target.value)}
                />
              </Grid>
              <Grid item xs={12} md={4}>
                <TextField
                  label="Skill 3"
                  fullWidth
                  value={skill3}
                  onChange={(e) => setSkill3(e.target.value)}
                />
              </Grid>
              <Grid item xs={12}>
                <Button variant="contained" onClick={createPet}>
                  Add Pet
                </Button>
              </Grid>
            </Grid>
          </Paper>
        </div>
      </div>
    </div>
    
  );
};

export default PetCreatePage;
